INSERT INTO `bitacora_coment_seg_p` (`id_seg_punto`, `seg_punto`, `responsable`, `id_punto_solicitud`, `created_at`, `updated_at`) VALUES
(2, '*Se realizó el formulario de registro de operarios con los siguientes campos: Sección(opción de lista desplegable), Operario(opción de lista desplegable), Fecha de permiso(se toma la fecha del día actual, pero permite escoger otra fecha en caso de que se requiera), Desde, Hasta, Motivo, Observaciones y Descontable de tiempo(permite escoger entre las opciones SI o NO).', 'TORRES AGUDELO MANUELA', 4, '2023-06-02 21:19:57', '2023-06-02 21:19:57'),
(3, 'Se validaron los campos del formulario para su correcto funcionamiento', 'TORRES AGUDELO MANUELA', 4, '2023-06-02 21:32:16', '2023-06-02 21:32:16'),
(4, 'Las pruebas del formulario salieron correctamente', 'TORRES AGUDELO MANUELA', 4, '2023-06-02 21:34:01', '2023-06-02 21:34:01'),
(5, 'Se empieza con el desarrollo de la interfaz gráfica', 'TORRES AGUDELO MANUELA', 5, '2023-06-02 21:44:54', '2023-06-02 21:44:54'),
(18, 'Los datos recibidos del formulario de visualización de permisos se envían de forma correcta a la base de datos', 'TORRES AGUDELO MANUELA', 6, '2023-06-06 13:50:56', '2023-06-06 13:50:56'),
(7, 'Se realiza el desarrollo de codificación para el correcto funcionamiento de la página mostrando los datos ingresados previamente en el formulario', 'TORRES AGUDELO MANUELA', 5, '2023-06-05 12:02:45', '2023-06-05 12:02:45'),
(8, 'Se validan los campos con su correcto funcionamiento', 'TORRES AGUDELO MANUELA', 5, '2023-06-05 13:34:14', '2023-06-05 13:34:14'),
(9, 'Se verifica el correcto funcionamiento del botón de \"acción\", el cual se encarga de enviar los datos del operario a la siguiente tabla (actualización) con los datos previos del formulario de registro', 'TORRES AGUDELO MANUELA', 5, '2023-06-05 14:52:24', '2023-06-05 14:52:24'),
(10, 'Todas las pruebas realizadas resultaron correctas', 'TORRES AGUDELO MANUELA', 5, '2023-06-05 15:16:08', '2023-06-05 15:16:08'),
(11, 'Se crea el formulario basado en el formato del talonario, con los espacios requeridos para los datos: fecha, sección, operario, hora salida, hora regreso, motivo, observación, autorizado por(el nombre se toma del sistema dependiendo de la persona que realice el permiso), descontable de tiempo', 'TORRES AGUDELO MANUELA', 6, '2023-06-05 16:25:41', '2023-06-05 16:25:41'),
(12, 'Se realizan las diferentes consultas dentro de la API de la oficina principal', 'GAÑAN BUENO EDWIN OSWALDO', 9, '2023-06-05 17:01:48', '2023-06-05 17:01:48'),
(13, 'Se cerciora que se reciben los datos correctos de cada operario que son enviados de la tabla de visualización', 'TORRES AGUDELO MANUELA', 6, '2023-06-05 17:11:10', '2023-06-05 17:11:10'),
(14, 'Se verifica el funcionamiento adecuado de cada registro de datos y el botón para enviar los datos a la base de datos', 'TORRES AGUDELO MANUELA', 6, '2023-06-06 12:03:48', '2023-06-06 12:03:48'),
(19, 'El botón \'registrar salida\' funciona de manera correcta, actualizando en la base de datos la hora real en la que salió el empleado. concluyendo así que el formulario de actualización funciona en su totalidad', 'TORRES AGUDELO MANUELA', 6, '2023-06-06 15:00:04', '2023-06-06 15:00:04'),
(20, 'Se inicia con el diseño de la interfaz', 'TORRES AGUDELO MANUELA', 7, '2023-06-06 18:45:48', '2023-06-06 18:45:48'),
(21, 'Se hace la conexión a base de datos para mostrar en la tabla los permisos del día vigente', 'TORRES AGUDELO MANUELA', 7, '2023-06-07 16:21:20', '2023-06-07 16:21:20'),
(22, 'Se muestran de manera acertada los datos requeridos del operador', 'TORRES AGUDELO MANUELA', 7, '2023-06-07 18:54:31', '2023-06-07 18:54:31'),
(23, 'Se habilita la edición de los campos de fecha, motivo, observaciones y hora de entrada y salida, en caso de que por un motivo u otro haya que modificar el permiso del operario sin necesidad de generar un permiso nuevo', 'TORRES AGUDELO MANUELA', 7, '2023-06-07 18:57:09', '2023-06-07 18:57:09'),
(24, 'Los campos editan correctamente y se guarda el cambio en la base de datos', 'TORRES AGUDELO MANUELA', 7, '2023-06-07 20:28:30', '2023-06-07 20:28:30'),
(25, 'prueba', 'TORRES AGUDELO MANUELA', 7, '2023-06-07 20:29:04', '2023-06-07 20:29:04'),
(26, 'Se ejecutan las pruebas finales asegurando que todo funcione de manera correcta sin fallos', 'TORRES AGUDELO MANUELA', 7, '2023-06-09 13:38:29', '2023-06-09 13:38:29'),
(27, 'Se inicia con el diseño de la tabla que va a contener las estadísticas. Dicha tabla contiene los datos que hay en la tabla de historial de permisos, junto con dos columnas adicionales (tiempo ausente y tiempo restante) que serán las encargadas de mostrar los resultados de los tiempos de ausencia de cada empleado', 'TORRES AGUDELO MANUELA', 8, '2023-06-09 14:40:58', '2023-06-09 14:40:58'),
(28, 'Se hace la conexión a base de datos para traer la informacion requerida de cada empleado', 'TORRES AGUDELO MANUELA', 8, '2023-06-09 15:38:27', '2023-06-09 15:38:27'),
(29, 'Se insertan correctamente en la tabla los datos del empleado', 'TORRES AGUDELO MANUELA', 8, '2023-06-09 16:01:30', '2023-06-09 16:01:30'),
(30, 'Para especificar, los campos de hora salida y hora retorno son por decirlo de alguna manera, horas posibles en que el empleado puede salir o llegar. Los campos de hora salida real y hora retorno real, son las horas en las que  se accionaron los botones de \'registrar salida\' y \'registrar reingreso\' marcando así la hora exacta en el que el empleado salió o reingresó del permiso', 'TORRES AGUDELO MANUELA', 8, '2023-06-09 16:25:01', '2023-06-09 16:25:01'),
(31, 'Con los datos ya ingresados, lo siguiente fue hacer los cálculos con la hora de salida real y hora de retorno real', 'TORRES AGUDELO MANUELA', 8, '2023-06-09 17:05:33', '2023-06-09 17:05:33'),
(32, 'Ya en esta parte se muestran los resultados de horas. Si el empleado tardó más del tiempo estipulado se marcará en rojo, y en la columna siguiente se pondrá el tiempo extra que tardó. De lo contrario, si llegó antes de lo estipulado se marcará en verde, y de la misma manera en la casilla siguiente verá el tiempo que le sobró(esta cifra aparecerá con signo negativo ya que es lo que falta para completar las 2 horas de permiso )', 'TORRES AGUDELO MANUELA', 8, '2023-06-09 18:49:27', '2023-06-09 18:49:27'),
(33, 'Se realiza la solicitud conforme a lo establecido, se buscan las personas que tengan sean para declinar y se seleccionan todos al mismo tiempo', 'SISTEMAS ALBURA', 21, '2023-07-11 13:47:13', '2023-07-11 13:47:13'),
(34, 'Se realiza la solicitud conforme a lo establecido, se buscan las personas que tengan sean para declinar y se seleccionan todos al mismo tiempo', 'SISTEMAS ALBURA', 21, '2023-07-11 13:48:30', '2023-07-11 13:48:30'),
(35, 'Se realiza la solicitud conforme a lo establecido, se buscan las personas que tengan sean para declinar y se seleccionan todos al mismo tiempo', 'SISTEMAS ALBURA', 21, '2023-07-11 13:50:02', '2023-07-11 13:50:02'),
(36, 'Se realiza la solicitud conforme a lo establecido, se buscan las personas que tengan sean para declinar y se seleccionan todos al mismo tiempo', 'SISTEMAS ALBURA', 21, '2023-07-11 13:50:24', '2023-07-11 13:50:24'),
(37, 'Se realiza la solicitud conforme a lo establecido, se buscan las personas que tengan sean para declinar y se seleccionan todos al mismo tiempo', 'SISTEMAS ALBURA', 21, '2023-07-11 13:50:57', '2023-07-11 13:50:57'),
(38, 'Se realiza la solicitud conforme a lo establecido, se buscan las personas que tengan sean para declinar y se seleccionan todos al mismo tiempo', 'SISTEMAS ALBURA', 21, '2023-07-11 13:51:54', '2023-07-11 13:51:54'),
(39, 'El flujo que cumple la aplicación es el siguiente: Como primera vista  tenemos REPORTE GENERAL DE HORNOS CON CARGUES VIGENTES, que muestra en la parte izquierda dos vínculos (Cargar Hornos y Reportes), y en la parte central una tabla con reportes vigentes. La sección de cargar hornos, lleva a una página que se encarga de que con información solicitada como medidas, cantidades, modelo, etc, se genere un reporte de cargue del horno ingresado (posteriormente esta información se muestra en la sección de REPORTES VIGENTES), y permite manipular la información con dos botones  que permiten actualizar la información tal como temperatura y humedad, y el boton de cumplir sube la información a la base de datos. La sección de reportes,  dirige a otra página donde se generan los reportes por horno y fecha ingresados. El botón de DESCARGAR EXCEL es el que permite generar el reporte requerido para llevar los registros de funcionamiento de los hornos. El botón de consultar horno, al igual que con la descarga de excel, filtra la información por número de horno y fecha y la información es mostrada en una tabla con la siguiente información: NCARGUE, FECHA, SERIE, LINEA, MADERA y ACCION. En la columna ACIÓN encontramos tres botones, el primero permite actualizar la información(tempreatura y humedad), el siguiente muestra el reporte de lecturas, y por último un botón que actualiza la información.', 'TORRES AGUDELO MANUELA', 14, '2023-07-11 16:32:45', '2023-07-11 16:32:45'),
(40, 'La consulta a base de datos usada para traer los datos requeridos es la siguiente:  SELECT c.NCARGUE, c.HORNO, c.FECHA, c.SERIE, c.LINEA, c.MADERA, c.canti,  c.MM, c.MS, c.MT, c.PG, a.FECHA, a.TPRO, a.HPRO, a.HABAJO, a.HMEDIO,  a.HARRIBA, a.ABAJO, a.MEDIO, a.ARRIBA FROM cargues c INNER JOIN  actcargues a ON(c.NCARGUE = a.NCARGUE) WHERE c.HORNO=\'$HORNO\' and c.FECHA between \'$FECHA1\' and \'$FECHA2\'.  Esta consulta une los datos de dos tablas(cargues, actcargues), trayendo  los datos según se filtren por horno y fecha (WHERE c.HORNO=\'$HORNO\' and c.FECHA between \'$FECHA1\' and \'$FECHA2\'),  generando de esta manera los registros para  el archivo requerido según las necesidades.', 'TORRES AGUDELO MANUELA', 15, '2023-07-11 16:33:11', '2023-07-11 16:33:11'),
(41, 'La ejecución de la descarga está en la sección de REPORTES=> REPORTE DE CARGUES POR HORNO. Y se genera de la siguiente manera: Después de seleccionar número de horno y rango de fechas que quiera consultar, acciona el  botón DESCARGAR EXCEL, el cual genera la siguiente información en el orden mostrado a continuación: NCARGUE, HORNO, FECHA, SERIE, LINEA,  MADERA, CANTIDAD, MEDIDAS DE MADERA, MEDIDAS DE SEPARADORES, METROS, PULGADAS, FECHA DE LECTURA,  TEMPERATURA PROGRAMADA, HUMEDAD PROGRAMADA, HUMEDAD(ABAJO, MEDIO, ARRIBA), LECTURAS ADELANTE HUMEDAD(ABAJO, MEDIO, ARRIBA). Adicional a ello, junto al nombre del archivo de excel generado se incluye la fecha en que se descargó el archivo para llevar un control  adicional de la información(Ej: Reporte de cargue de hornos 2023-07-11).', 'TORRES AGUDELO MANUELA', 16, '2023-07-11 16:33:35', '2023-07-11 16:33:35'),
(42, 'Se realiza la respectiva actualización en el equipo de portería, el despliegue está listo', 'GAÑAN BUENO EDWIN OSWALDO', 23, '2023-07-11 21:23:39', '2023-07-11 21:23:39');
