(14, 'CREACION', 'Catálogo de productos', 'Se requiere visualizar la información de los productos tales como:\r\nLas existencias por item y la disponibilidad por bodegas', '2023-05-15', NULL, NULL, 'Completado', '100', 'success', 1093224111, 'CARDONA GONZALEZ FEDERICO', NULL, '7', '7', '2023-05-15 15:12:42', '2023-11-21 16:24:19'),
(13, 'ACTUALIZACION', 'App Seguimiento Automóviles', 'Se requiere la notificación un mes antes del vencimiento de los seguros para cada automóvil.', '2023-05-15', '2023-06-13', NULL, 'Completado', '100', 'success', 1093224111, 'CARDONA GONZALEZ FEDERICO', '3', '7', '7', '2023-05-15 15:07:46', '2023-09-19 14:52:07'),
(11, 'CREACION', 'Informe ciclos de hornos exportable en Excel', 'se requiere exportar a Excel informe general de los ciclos de hornos, permitiendo seleccionar criterios de numero horno ( son 4 hornos), fecha de vaciado, fecha llenado por cada ciclo, nombre serie expuesto en cada ciclo, etc. por un rangos o periodos específicos.', '2023-05-13', '2023-07-11', NULL, 'Completado', '100', 'success', 42150928, 'VIVIANA ROMERO', '3', '8', '8', '2023-05-14 00:29:30', '2023-07-11 16:33:35'),
(12, 'ACTUALIZACION', 'Actualización del CRM', 'Puntos:\n2- Crear los terceros desde el CRM en Siesa\n1- Realizar los pedidos desde el CRM a Siesa', '2023-05-15', '2023-06-28', NULL, 'Completado', '100', 'success', 1093224111, 'CARDONA GONZALEZ FEDERICO', NULL, '7', '7', '2023-05-15 15:02:12', '2023-10-24 13:14:52'),
(18, 'ACTUALIZACION', 'Manual de funciones Nexus', 'Por favor nos colaboran con la implementación directamente en Nexus del Manual de Funciones debido a que actualmente se esta subiendo es un archivo en PDF, con el fin de tener la información de forma estandarizada, es decir que todos los campos queden iguales y la fuente de información sea mas confiable por estar la información integrada en la Plataforma.\r\n1) % de Progreso: Favor mostrar la información de forma gráfica si ya todo el Manual de Funciones esta completado o si falta por terminar de de diligenciar alguna casilla.\r\n\r\n2) Reunión con Jefe de Diseño y Calidad y Coordinadora SGC: Por favor me informan para que día tienen disponibilidad de reunirnos con Diana y Stefannia para ultimar detalles de la estructura de la implementación de este formato en Nexus, con el fin de que quede bien definida la estructura que se requiere dentro del Sistema de Gestión de Calidad.\r\n\r\n2) Incluir los siguientes Campos: (Adjunto archivo archivo en Word con la estructura que se requiere en Nexus.)\r\n\r\nRelevancia:\r\n\r\n    Alto\r\n    Medio\r\n    Bajo\r\n\r\n\r\nFrecuencia:\r\n\r\n    Diario\r\n    Semanal\r\n    Quincenal\r\n    Mensual\r\n    Bimensual\r\n    Trimestral\r\n    Semestral\r\n    Anual\r\n    Por requerimiento', '2023-08-31', NULL, NULL, 'creada', '0', 'danger', 6401505, 'SISTEMAS ALBURA', NULL, '7', '7', '2023-08-31 14:10:32', '2023-08-31 14:10:32'),
(15, 'CREACION', 'FORMATO PERMISOS DIGITAL', 'Migrar de generar permisos físicos a hacerlos de manera digital por medio del reloj , con el fin de que se pueda elaborar desde el dispositivo móvil y la persona de portería lo pueda validar y aprobar .', '2023-06-02', '2023-07-11', NULL, 'Completado', '100', 'success', 1088270385, 'GUSTAVO ADOLFO ORTIZ PEREZ', '3', '8', '8', '2023-06-02 15:04:55', '2023-07-11 21:25:06'),
(17, 'CREACION', 'APP CONTROL DE PISO', 'se requiere una aplicación donde se pueda planear las tareas diarias de cada uno de los centros de trabajo capturando información importante sobre órdenes de trabajo, serie, actividad a desarrollar, hora inicio, hora finalización y cantidad de personas aplicadas a la actividad. Con esta información se deben sacar y analizar % de cumplimientos de eficiencias según estándares determinado para el producto.', '2023-06-15', NULL, NULL, 'creada', '0', 'danger', 42150928, 'ROMERO ACEVEDO VIVIANA MARIA', NULL, '8', '8', '2023-06-15 20:27:59', '2023-06-15 20:27:59'),
(16, 'ACTUALIZACION', 'CRM - Punto de venta', 'Para la actualización del punto de venta, se requiere que las ventas efectivas sean extraídas directamente del ERP/Siesa.\n\n* Información del cliente y productos adquiridos desde el ERP/Siesa para ventas efectivas.\n\n* Que se puedan seleccionar todas las personas al mismo tiempo para ser eliminadas y no estar seleccionando una por una.', '2023-06-05', '2023-07-07', NULL, 'Completado', '100', 'success', 1093224111, 'CARDONA GONZALEZ FEDERICO', '1', '7', '7', '2023-06-05 16:31:57', '2023-07-11 13:52:52'),
(19, 'CREACION', 'CRM - RESTAURANTE OCTAVO', 'Implementación de las estadísticas y minería de datos con las reservas al restaurante OCTAVO', '2023-08-31', NULL, NULL, 'creada', '0', 'danger', 6401505, 'SISTEMAS ALBURA', NULL, '7', '7', '2023-08-31 16:10:44', '2023-08-31 16:10:44'),
