(31, 'ACTUALIZACION', 'CATALOGO', 'Integrar el catalogo con el ERP SIESA - Revisar las consultas generadas para garantizar una información biable', '2023-12-21', NULL, NULL, 'En proceso', '50', 'info', 1007328932, 'GAÑAN EDWIN', '5', '7', '7', '2023-12-21 05:00:00', '2023-12-21 05:00:00'),
(32, 'ACTUALIZACION', 'MESA DE AYUDA', 'Actualizar las notificaciones automaticamente dependiendo el tiempo trascurrido y llevar un histórico de las cumplidas y aceptadas por las personas solicitantes', '2023-12-21', NULL, NULL, 'En proceso', '10', 'info', 1007328932, 'GAÑAN EDWIN', '6', '7', '7', '2023-12-21 05:00:00', '2023-12-21 05:00:00'),
(33, 'ACTUALIZACION', 'Estadísticas de tiempos y reportes - Servicios Técnicos', 'necesitamos un indicador que mida el  tiempo de respuesta por proceso desde que el cliente solicita un servicio técnico hasta que es devuelto nuevamente ya reparado, marcando los tiempos por etapas ejemplo: tiempo solicitud servicio, tiempo recogida, tiempo reparacion en taller, tiempo transporte, tiempo entrega del producto y tambien un informe que me permita poder saber las causalidades por las cuales estan ingresando los servicios tecnicos.', '2024-04-11', NULL, NULL, 'creada', '0', 'danger', 6401505, 'SISTEMAS MUEBLES ALBURA SAS', NULL, '7', '7', '2024-04-11 13:24:21', '2024-04-11 13:24:21'),
(34, 'ACTUALIZACION', 'Formato firma días de descanso asesores', 'nos permitimos solicitarle el siguiente desarrollo en la plataforma, teniendo en cuenta que ya poseemos el calendario de los días bajo los siguientes parámetros:\r\n\r\n1-. La toma o captura  de la fotografía del empleado (a) como prueba similar a lo visto, cuando leemos el R.I.T en la intranet .\r\n\r\n2-. Marcación del día en que se tomó el descanso compensatorio y a su vez plasmando en observaciones de forma desplegable , si corresponde a uno vigente, adelantado o atrasado, destacando la fecha del domingo o feriado al que se hace alusión.', '2024-04-11', NULL, NULL, 'creada', '0', 'danger', 6401505, 'SISTEMAS MUEBLES ALBURA SAS', NULL, '7', '7', '2024-04-11 13:36:05', '2024-04-11 13:36:05');
