INSERT INTO `frases_filosofos` (`id_frase`, `maxima`) VALUES
(1, 'No dejes crecer la hierba en el camino de la amistad - Socrates'),
(2, 'La ciencia humana consiste más en destruir errores que en descubrir verdades - Socrates'),
(3, 'Solo el conocimiento que llega desde dentro es el verdadero conocimiento - Socrates'),
(4, 'La felicidad está en la libertad, y la libertad en el coraje - Pericles'),
(5, 'La música es para el alma lo que la gimnasia para el cuerpo - Platon'),
(6, 'Buscando el bien de nuestros semejantes, encontramos el nuestro - Platon'),
(7, 'La finalidad del arte es dar cuerpo a la esencia secreta de las cosas, no el copiar su apariencia - Aristoteles'),
(8, 'El amor consiste en sentir que el ser sagrado late dentro del ser querido - Platon'),
(9, 'El amigo ha de ser como el dinero, que antes de necesitarlo, se sabe el valor que tiene - Socrates'),
(10, 'Yo solo sé que no sé nada - Socrates'),
(11, 'La belleza es el esplendor de la verdad - Platon'),
(12, 'La inteligencia consiste no solo en el conocimiento, sino también en saber aplicar los conocimientos en la práctica - Aristoteles'),
(13, 'La esperanza es el sueño del hombre despierto - Aristoteles'),
(14, 'Si me engañas una vez, tuya es la culpa; si me engañas dos, es mía - Anaxagoras'),
(15, 'Piensa como piensan los sabios, mas habla como habla la gente sencilla - Aristoteles'),
(16, 'El sabio no dice todo lo que piensa, pero siempre piensa todo lo que dice - Aristoteles'),
(17, 'La cosa más difícil es conocernos a nosotros mismos; la más fácil es hablar mal de los demás - Tales de Mileto'),
(18, 'El que habla, siembra. El que escucha, recoge - Pitagoras'),
(19, 'La naturaleza de los hombres es siempre la misma, lo que las diferencias son sus hábitos - Confucio'),
(20, 'Aceptar y respetar la diferencia es una de esas virtudes sin las cuales la escucha no se puede dar - Paulo Freire'),
(21, 'El regalo más grande que les puedes dar a los demás es el ejemplo de tu propia vida - Bertolt Brecht'),
(22, 'El tiempo todo lo da y todo lo quita; todo cambia pero nada perece - Giordano Bruno'),
(23, 'Pienso, luego existo - Rene Descartes'),
(24, 'No se puede desatar un nudo sin saber cómo está hecho - Aristoteles'),
(25, 'La risa es el gran antídoto contra los venenos del espíritu - Angel Osorio'),
(26, 'La boca puede mentir, pero la mueca del momento revela la verdad - Friedrich Nietzsche'),
(27, 'En algún lugar, algo increíble está esperando a ser descubierto - Carl Sagan'),
(28, 'El pensador sabe considerar las cosas más sencillas de lo que son - Friedrich Nietzsche'),
(29, 'Solo aquellos que intentan el absurdo pueden lograr lo imposible - Albert Einstein'),
(30, 'La imaginación nos lleva a mundos en los que nunca estuvimos - Carl Sagan'),
(31, 'La belleza no dimana de un cuerpo hermoso, sino de las bellas acciones - Tales de Mileto'),
(32, 'La musica que no describa algo no es mas que ruido - Parmenidez de Elea'),
(33, 'El conocimiento empieza en el asombro - Socrates'),
(34, 'Solo se ha perdido cuando se deja de luchar - Pirron de Elis'),
(35, 'Olvidemos lo que ya sucedio, pues puede lamentarse, pero no rehacerse - Tito Livio'),
(36, 'Quien se enfada por las criticas, reconoce que las tenia merecidas - Tacito'),
(37, 'No juzgues el pasado de los demas, no conoces tu futuro - Proverbio chino'),
(38, 'La educacion es el arma mas poderosa que puedes usar para cambiar el mundo - Nelson Mandela'),
(39, 'Para conseguir la paz se necesita valor, mucho más que para hacer la guerra - Francisco'),
(40, 'Para conseguir la paz se necesita valor, mucho mas que para hacer la guerra - Mark Twain'),
(41, 'La belleza no dimana de un cuerpo hermoso, sino de las bellas acciones - Tales de Mileto'),
(42, 'Es preferible cambiar una opinion que persistir en una incorrecta - Socrates'),
(43, 'La paciencia es amarga, pero su fruto es dulce - Jean Jacques'),
(44, 'Cuanto mas grande es la dificultad, mas gloria hay en superarla - Epicuro'),
(45, 'Los hombres sabios hablan porque tienen algo que decir; los tontos porque tienen que decir algo - Platon'),
(46, 'Todo el mundo ve lo que aparentas ser, pocos experimentan lo que realmente eres -Maquiavelo'),
(47, 'Si quieres que el presente sea diferente del pasado, estudia el pasado - Baruch Spinoza'),
(48, 'El futuro influye en el presente tanto como el pasado - Nietzsche'),
(49, 'El hombre es totalmente responsable de su naturaleza y elecciones - Jean Paul Sartre'),
(50, 'Si quieres una cualidad, actua como si ya la tuvieras - William James'),
(51, 'No es suficiente tener una buena mente; lo principal es usarla bien - Rene Descartes'),
